    const fetchInfo = async () => {
      const { data } = await axios.get('http://localhost:5000/test')

      console.log("infetchinfo")
      console.log(data);

      setInfo(data);
    }

    fetchInfo();

  }, [])


  return (
    <div>
      <h1>{ info }</h1>
    </div>
  );
}

export default App;
